import axios from "axios";
import { GET_ERRORS, GET_PROFILE_BACKLOG } from "./types";

export const getProfileBacklog = backlog_id => async dispatch => {
  try {
    const res = await axios.get(`/api/profileBacklog/${backlog_id}`);
    dispatch({
      type: GET_PROFILE_BACKLOG,
      payload: res.data
    });

    dispatch({
      type: GET_ERRORS,
      payload: {}
    });
  } catch (err) {
    dispatch({
      type: GET_ERRORS,
      payload: err.response.data
    });
  }
};
